import ExpenseItem from "./ExpenseItem";
import ExpensesFilter from "./ExpensesFilter";
import "./Expenses.css";

function Expenses(props) {
  const YearFilterHandler = (year) => {
    console.log(year);
  };

  let expenses_render = [];
  expenses_render = props.expenses.map((e) => {
    return (
      <div>
        <div>
          <ExpensesFilter onYearFilter={YearFilterHandler} />
        </div>
        <div>
          <ExpenseItem
            id={e.id}
            date={e.date}
            title={e.title}
            amount={e.amount}
          ></ExpenseItem>
        </div>
      </div>
    );
  });

  return <div className="expenses">{expenses_render}</div>;
}

export default Expenses;
